css:
.atom-runner {
  background: #fff;
  padding: 0px 20px;
  padding-bottom: 20px;
  overflow-y: scroll;
}
.atom-runner pre {
  background-color: #f0f0f0;
  border: 1px solid #cccbba;
}
.atom-runner pre .stderr {
  color: red;
}
.atom-runner .footer {
  margin-top: 8px;
  margin-left: 10px;
  color: #333;
}
